INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (2, 137701, 10, 10040, 1, 5.549, 0.0, "ヴォルガーノ", -470.0, "2025/09/16 15:00:00", 2002, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 1, "2025/12/22 14:59:59");
