INSERT INTO `v1_5b9d75c11bd3bf5f1866c32ff9319da290fec932b6ad0e17a13eaaccdc5d7daf` VALUES (7, 132801, 11, 10042, 1, 7.642, 0.0, "ライラエル", -470.0, "2025/12/15 15:00:00", 2002, "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 4, "2026/03/23 11:59:59");
